const Card = ({post}) => {
  return (
    <div className="card">
        <Link className= "link" to={`/post/${post.id}`}></Link>
        <span className="title">{post.title}</span>
        <img src={post.img} alt="" className = "img"/>
        <p className="desc"> {post.desc}</p>
        <button className="cardButton">Read more</button>
    </div>
  );
};

export default Card;
